Question:Build a Java program that uses the Math class to compute the sum of the first n positive integers, where n is an input. Your program should use a for loop to iterate over the first n positive integers, and should use the sum() method of the Math class to compute the sum.

Solution:Here is some sample java code which uses the Math class to compute the sum of the first n positive integers:

    public class MathSum {

    public static void main(String[] args) {

        // Get the input from the user
        Scanner scanner = new Scanner(System.in);

        // Read the input
        System.out.println("Bitte geben Sie die Anzahl n ein:");
        int n = scanner.nextInt();

        // Erstellen einer Variablen, welche die Summe der ersten n positiven Zahlen
        int sum = 0;

        // Iteration über die erste n positiven Zahlen
        for (int i = 1; i <= n; i++) {
            sum += i;
        }

        // Ausgeben der Summe
        System.out.println("Die Summe der ersten " + n + " positiven Zahlen beträgt: " + sum);

    }

}
