def count_primes(n):
    """
    Given a positive integer n, return the number of prime numbers less than or equal to n.
    """
    # Initialize a list to store the prime numbers
    prime_numbers = []

    # Iterate over the numbers from 2 to n
    for i in range(2, n+1):
        # Check, ob der Präzis ist n, ist n auch ein Primzahl
        if i % 2 == 0:
            # Wenn der Präzis ist, und n auch ein Primzahl, ist der Zehner teilbar
            if i % 10 == 0:
                # Wenn der Zehner teilbar ist, ist der Zehner teilbar
