def find_dog_owners(dog_names, dog_owners):
    """
    Find all dog owners who have a dog with the name "Max".

    :param dog_names: The list of dog names
    :param dog_owners: The list of dog owners
    :return: A list of all dog owners who have a dog with the name "Max"
    """
    max_dog = "Max"
    max_dog_owners = []
    for dog in dog_names:
        if dog == max_dog:
            for owner in dog_owners:
                if owner == "Max":
                    max_dog_owners.append(owner)
    return max_dog_owners
